You can also use a ClientBuilder to build a config programmatically. Here's an extensive example: client, err := NewClientBuilder(). // network WithNetworkName("my network"). // if empty we will ask the RPC node for the chain ID WithNetworkChainId(1337). WithRpcUrl("ws://localhost:8546"). WithPrivateKeys([]string{"ac0974bec39a17e36ba4a6b4d238ff944bacb478cbed5efcae784d7bf4f2ff80"}). WithRpcDialTimeout(10*time.Second). WithTransactionTimeouts(1*time.Minute). // addresses WithEphemeralAddresses(10, 10). // tracing WithTracing(seth.TracingLevel_All, []string{seth.TraceOutput_Console}). // protections WithProtections(true, true, seth.MustMakeDuration(2*time.Minute)). // artifacts folder WithArtifactsFolder("some_folder"). // folder with gethwrappers for ABI decoding WithGethWrappersFolders([]string{"./gethwrappers/ccip", "./gethwrappers/keystone"}). // nonce manager WithNonceManager(10, 3, 60, 5). // EIP-1559 and gas estimations WithEIP1559DynamicFees(true). WithDynamicGasPrices(120_000_000_000, 44_000_000_000). WithGasPriceEstimations(true, 10, seth.Priority_Fast). // gas bumping: retries, max gas price, bumping strategy function WithGasBumping(5, 100_000_000_000, PriorityBasedGasBumpingStrategyFn). Build() if err != nil { log.Fatal(err)
} By default, it uses the same values as simplified configuration, but you can override them by calling the appropriate methods. Builder includes only options that we thought to be most useful, it's not a 1:1 mapping of all fields in the Config struct. Therefore, if you need to set some more advanced options, you should create the Config struct directly, use TOML config or manually set the fields on the Config struct returned by the builder. It' also possible to use the builder to create a new config from an existing one: client, err := NewClientBuilderWithConfig(&existingConfig). UseNetworkWithChainId(1337). WithEIP1559DynamicFees(false). Build() if err != nil { log.Fatal(err)
} This can be useful if you already have a config, but want to modify it slightly. It can also be useful if you read TOML config with multiple Networks and you want to specify which one you want to use.

